import React from 'react';
import "./Card.css";
function Card({person}) {
	return(
		<div className="card">
  <div className="card-details">
    <p className="text-title">person.course_title</p>
    <p className="text-body">person.name</p>
  </div>
  <button className="card-button">More info</button>
</div>
	);
}

export default Card;
